import React from 'react';
import './App.css';
import axios from 'axios';

const App = () => {
  const getContacts = async () => {
    const res = await axios.post(`/api/sign-up`, {
      username: 'username',
      password: 'password',
      email: 'username@password.com',
    });
    console.log(res.data);
  };

  return (
    <div className='App'>
      <button onClick={getContacts}>Save</button>
    </div>
  );
};

export default App;
